        <h1>About Us</h1>
        <p>Our Company was initially established under the name Ch Leong Enterprise, story is founder Mr. Leong Chin Hai on 16 December 1997.</p>
        <p>At first he only sold vegetables in the markets and as the business grew he became a supplier of vegetables to traders around Selangor. Later the company name was changed to Ch Leong Enterprise Sdn. Bhd. In 2014. Ch Leong Company continues to grow and is involved in the importation of fresh fruits and vegetables. With packaging and cold storage facilities, we have the ability to supply fruits and vegetables throughout Malaysia. In 2019 Mr. Leong Chin Hai has passed away and his business has been taken over by his business partner. Although he was gone but his business continued. Now the name CH LEONG has also been registered with the intellectual property corporation (MYiPPO). This is to maintain his name as the founder to CH LEONG.</p>
